import React from "react";
export default class Home extends React.Component {

    async fetchData(){
        try {
            let res = await fetch('http://localhost:8000/api/home');
            res = await res.json();
            console.log(res);
        } catch (error) {
            console.error(error);
        }
    }
    componentDidMount(){
        console.log("mounted");
    }


    render(){
        return(
            <div>Home</div>
        )
    }
}
